ts for 31 yards in the Cardinals' 28-21 loss to the Seahawks on Thursday night.\",\"analysis\":\"Drake's modest rushing tally led the Cardinals for the night, although the fifth-year back did reward fantasy managers with a two-yard scoring run early in the second quarter. The 26-year-old was coming off his second 100-yard effort of the campaign in Week 10 against the Bills, but Seattle's run defense performed up to its usual elite standards and held Drake to a season-low yardage total in the process. Drake appeared to move around well on the previously gimpy ankle he's been nursing back to health, and he'll now have extra time before having to face the Patriots in a Week 12 road battle on Sunday, Nov. 29.\",\"title\":\"Modest totals in loss\"},{\"timeEpochMilli\":\"1605847422000\",\"contents\":\"Arizona Cardinals running back Kenyan Drake scored his fifth rushing touchdown of the year in Week 11 against the Seattle Seahawks. He had a rough game on the ground overall, gaining just 29 yards on 11 attempts, but the touchdown helped make his fantasy stat-line solid. He also saw a season-high five targets in the passing game and came up with four catches for 31 yards. If Drake can continue to see around four or five targets a game, he'll have significantly more upside.\",\"url\":\"https://www.rotoballer.com/player-news/kenyan-drake-scores-a-touchdown-in-week-11/806083\",\"title\":\"Kenyan Drake Scores A Touchdown In Week 11\"}],\"nameFirst\":\"Kenyan\",\"nameLast\":\"Drake\",\"proTeam\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6299,\"away\":{\"abbreviation\":\"ARI\",\"location\":\"Arizona\",\"name\":\"Cardinals\"},\"home\":{\"abbreviation\":\"SEA\",\"location\":\"Seattle\",\"name\":\"Seahawks\"},\"startTimeEpochMilli\":\"1605835200000\",\"status\":\"FINAL_SCORE\",\"awayScore\":21,\"homeScore\":28,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNo